import React from 'react';

const AnalysisResults = ({ results, onReset }) => {
  if (!results || !results.clauses) {
    return (
      <div className="text-center py-8">
        <p className="text-gray-500">No analysis results available</p>
        <button
          onClick={onReset}
          className="mt-4 px-4 py-2 bg-blue-500 text-white rounded hover:bg-blue-600"
        >
          Upload Another File
        </button>
      </div>
    );
  }

  return (
    <div className="space-y-6">
      <div className="flex justify-between items-center">
        <h2 className="text-2xl font-bold text-gray-900">Analysis Results</h2>
        <button
          onClick={onReset}
          className="px-4 py-2 bg-blue-500 text-white rounded hover:bg-blue-600"
        >
          Upload Another File
        </button>
      </div>

      <div className="bg-white shadow overflow-hidden sm:rounded-lg">
        <div className="px-4 py-5 sm:px-6">
          <h3 className="text-lg leading-6 font-medium text-gray-900">
            Contract Analysis
          </h3>
          <p className="mt-1 max-w-2xl text-sm text-gray-500">
            Detailed analysis of contract clauses
          </p>
        </div>
        <div className="border-t border-gray-200">
          <dl>
            {results.clauses.map((clause, index) => (
              <div
                key={index}
                className={`${
                  index % 2 === 0 ? 'bg-white' : 'bg-gray-50'
                } px-4 py-5 sm:grid sm:grid-cols-3 sm:gap-4 sm:px-6`}
              >
                <dt className="text-sm font-medium text-gray-500">Clause {index + 1}</dt>
                <dd className="mt-1 text-sm text-gray-900 sm:mt-0 sm:col-span-2">
                  <div className="space-y-2">
                    <p className="font-medium">{clause.text}</p>
                    <div className="flex items-center space-x-4">
                      <span className={`px-2 py-1 rounded text-sm ${
                        clause.risk_level === 'High' ? 'bg-red-100 text-red-800' :
                        clause.risk_level === 'Medium' ? 'bg-yellow-100 text-yellow-800' :
                        'bg-green-100 text-green-800'
                      }`}>
                        {clause.risk_level} Risk
                      </span>
                      <span className="text-sm text-gray-500">
                        Type: {clause.type}
                      </span>
                    </div>
                    <p className="text-sm text-gray-600">
                      {clause.explanation}
                    </p>
                  </div>
                </dd>
              </div>
            ))}
          </dl>
        </div>
      </div>
    </div>
  );
};

export default AnalysisResults;
